import React, { useState }from 'react';
import { Button, Form } from 'react-bootstrap';
import ButtonBar from './button';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const axios = require('axios');


function Nedbetalingsplan() {
    const [bAmount, setBAmount] = useState(0);
    const [rate, setRate] = useState(0);
    //const [fee, setFee] = useState(0);
    const [expDate, setExprDate] = useState("");
    const [balanceDate, setBalanceDate] = useState("");
    const [dateFirstPay, setDateFirstPay] = useState("");
    //const [unkValue, setUnkVal] = useState("");
    const [nedbetalingsplan, setNedbetalingsPlan] = useState([])
    const [showResult, setShowResult] = useState(false)





    function handlePost(e) {
        e.preventDefault();

        const options = {
            method: 'POST',
            url: 'https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan',
            headers: { 'Content-type': 'application/json' },
            data: {
                laanebelop: bAmount,
                nominellRente: rate,
                terminGebyr: 30,
                utlopsDato: expDate,
                saldoDato: balanceDate,
                datoForsteInnbetaling: dateFirstPay,
                ukjentVerdi: "TERMINBELOP"

            }
        }
        console.log(bAmount)


        axios(options).then(function (response) {
            console.log(response)
            console.log(response.data.nedbetalingsplan)
            setNedbetalingsPlan(response.data)
        }).catch(function (error) {
            console.log(error);
        });


        function createData(restgjeld, dato) {
            return { restgjeld, dato };
        }

        const rows = nedbetalingsplan && nedbetalingsplan.innbetalinger.map(plan =>  (
            <TableContainer component={Paper}>
            <Table aria-label="simple table">
                <TableHead>
                    <TableRow>
                        <TableCell>{plan.restgjeld}</TableCell>
                        <TableCell align="right">Dato</TableCell>

                    </TableRow>
                </TableHead>
                <TableBody>
                    {rows.map((row) => (
                        <TableRow key={row.name}>
                            <TableCell component="th" scope="row">
                                {row.name}
                            </TableCell>
                            <TableCell align="right">{row.restgjeld}</TableCell>
                            <TableCell align="right">{row.dato}</TableCell>

                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
        )       )


    }



    return (
        <div>
            <div>
                <button>OPEN ME</button>
                <label>Lånebeløp</label>
                <ButtonBar setValue={setBAmount} interval={1000} defaultValue={0} />
            </div>
            <div>
                <label>Nominell rente</label>
                <ButtonBar setValue={setRate} interval={0.1} defaultValue={1.5} />
            </div>
            <div>
                <label>Låneperiode slutt</label>
                <Form.Control type="text" placeholder="yyyy-mm-dd" value={expDate} onChange={e => setExprDate(e.target.value)}></Form.Control>
            </div>
            <div>
                <label>Låneperiode start</label>
                <Form.Control type="text" placeholder="yyyy-mm-dd" value={balanceDate} onChange={e => setBalanceDate(e.target.value)}></Form.Control>
            </div>
            <div>
                <label>Dato ved første innbetaling</label>
                <Form.Control type="text" placeholder="yyyy-mm-dd" value={dateFirstPay} onChange={e => setDateFirstPay(e.target.value)}></Form.Control>
            </div>
            <Button type="submit" onClick={handlePost}>Send</Button>







        </div>
    )



}
export default Nedbetalingsplan;
